import { useMenuContext } from "../components/utils/useMenuContext"
import { motion } from "framer-motion"

const Wrapper = styled("div")(({ theme, navOpen }) => ({
  display: "grid",
  gridTemplateColumns: "repeat(24, 1fr)",
  gridTemplateRows: navOpen ? "repeat(12, 1fr)" : "unset",
  position: "fixed",
  top: 0,
  paddingTop: "var(--ms0)",
  left: 0,
  right: 0,
  bottom: navOpen ? 0 : "unset",
  zIndex: 3,
  width: "100vw",
  backgroundColor: navOpen && "var(--original-primary)",
  transition: "all 0.2s ease-in-out 0s",
  pointerEvents: "none",
  paddingBottom: "var(--ms4)",
  [theme.breakpoints.up("lg")]: {
    paddingTop: "var(--ms4)",
  },
}))

const Container = styled("div")(({ theme }) => ({
  display: "grid",
  gridColumn: "2/24",
  gridRow: "1/1",
  gridTemplateColumns: "repeat(11, 1fr)",
  backgroundColor: contrastBrandPalette["Original Large"]?.value,
  borderRadius: "99px",
  border: "3px solid rgba(255, 255, 255, 0.60)",
  padding: "var(--ms-1)",
  justifyContent: "flex-end",
  alignItems: "center",
  maxHeight: "fit-content",
  height: "fit-content",
  position: "relative",
  zIndex: 10,
  [theme.breakpoints.up("lg")]: {
    padding: "var(--ms0)",
    gridColumn: "9/17",
  },
}))

const Logo = styled("div")(({ theme }) => ({
  gridColumn: "5/10",
  display: "grid",
  justifyContent: "center",
  pointerEvents: "visible",
  [theme.breakpoints.up("sm")]: {
    gridColumn: "5/9",
  },
  [theme.breakpoints.up("lg")]: {
    gridColumn: "5/8",
  },
}))

const MenuButton = styled("div")(({ theme }) => ({
  gridColumn: "18/24",
  display: "grid",
  pointerEvents: "visible",
  [theme.breakpoints.up("lg")]: {
    gridColumn: "11/11",
  },
}))

const Navigation = styled("div")(({ theme, navOpen }) => ({
  display: "grid",
  gridTemplateColumns: "repeat(24, 1fr)",
  gridRow: "2/2",
  position: "fixed",
  left: 0,
  visibility: !navOpen ? "hidden" : "visible",
  opacity: !navOpen ? 0 : 1,
  pointerEvents: !navOpen ? "none" : "auto",
  right: 0,
  bottom: 0,
  top: 0,
  zIndex: 3,
  justifyContent: "center",
  alignItems: "center",
  marginTop: "var(--ms8)",
  overflowY: "scroll",
  [theme.breakpoints.up("lg")]: {
    height: "fit-content",
    overflowY: "unset",
    marginTop: 0,
    top: "50%",
    transform: "translateY(-50%)",
  },
}))

